script: |
  super -f text -I q11288.spq | sort > q11288.out

inputs:
  - name: q11288.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE NOT 35 BETWEEN col2 * col0 + ( - - 71 ) AND + - col0 * + + 67 * - ( + + col1 ) - - - col0 * + - ( + - 48 ) + col1;
  - name: tab1

outputs:
  - name: q11288.out
    data: |
      51	14	96
      85	5	59
      91	47	68
